	local function Tween(Object, TweenDirection, TweenStyle, TweenTime, Goal)
		local TInfo = TweenDirection and TweenInfo.new(TweenTime, TweenStyle, TweenDirection) or TweenInfo.new(TweenTime, TweenStyle)
		local Tween = TweenService:Create(Object, TInfo, Goal)
		Tween:Play()
		return Tween
	end

	local function typeText(chosentext,textloaded,textload,charDelay)
		local typedText = ""
		if textloaded ~= nil then
			typedText = textloaded
		end
		if charDelay == nil then
			for i = 1, #textload do
				typedText = typedText .. textload:sub(i, i)
				chosentext.Text = typedText
				charDelay = math.random(1,6)/10
				if chosentext.Text ~= textload then
					task.wait(charDelay)
				end
			end
		else
			for i = 1, #textload do
				typedText = typedText .. textload:sub(i, i)
				chosentext.Text = typedText
				task.wait(charDelay)
			end
		end
	end

