												if music.Playing == false and CollectionService:HasTag(music,"MusicOff") then
													CollectionService:RemoveTag(music,"MusicOff")
													music.Playing = true
													Tween(music,Enum.EasingDirection.InOut, Enum.EasingStyle.Sine, 0.45, {
														PlaybackSpeed = 0.65
													})
												end
											end)
										end
									end)
									task.wait(0.2)
									isScaring = false
									Tween(Overlay.Vignette,Enum.EasingDirection.InOut, Enum.EasingStyle.Sine, 0.25, {
										ImageColor3 = Color3.fromRGB(45, 45, 45)
									})
								end
							end
						end)
					end
				end
			end
		end
	end

	if Overlay.ContinuePrompt.Visible == false and Overlay.Slots:FindFirstChild("A") then
		beginCreepWoken()
	else
		local connection
		connection = Overlay.ContinuePrompt:GetPropertyChangedSignal("Visible"):Connect(function()
			if Overlay.ContinuePrompt.Visible == false then
				connection:Disconnect()
				beginCreepWoken()
			end
		end)
	end

	warn("w̷̧̡̧̧̛̛̛̮͈̹͔̘͚͓̯̖̟̼̹͍̫̹̩̪̤̬͚̭̗̖̬̫̬͈̖͎̫̪̤͇̝͙̱̖̻̤͈͇̪̝͍̬̠̱͉̺̳̺̺͇͉̗̯̎̾̅͗̓͒͊̇̎̌̌́͋̒̎̎̾̂̈́̉̐̈́́͑̈́̌̐̌͛͒̎̂̊̐̂̃́̎̆̍̑̉̚̚̕͜͜͜͝͝͠͝e̷̡̧̛̙̰͚͍̣̣̥̭͔͚̱̮̬͓̟͈̮̼͔̮̥̤̮̮̰̝̳̘͈̞̖̩͔͎̩̱̦͍͚̓̉͋̾̆̑̌̉͑̆̉̌͒̊̽̽̄́̿̌̿͘ ̸̨̛̛͓̗̟̞̔̅̆̃͐͊̄̍͑̏̾̍̀͌͒̓̉͋̓̈͗͆̎͂̈́̈́̽̑̐̆͊̋̇̎̐̐̀̈͛̈́͌̒̿̃̒̕̕̚͝͝͝͝͠͝A̴̢̢̲̳̺̻̜̣͚̳̺̩̱̥̲̟̜͛̉̏̍̒̓͌́̏̆̿̃͋̾͗͑̔̈̊̕͝͝͠r̷̨̨̢̨̨̧̢̛̻̝̰̼̫̬̭͕̝͓̤̪͙̪̗̼̼̜̞̻͉͓̬͓̩̙̞̖̖̪̣͖͓̭̺̫̽̂͌̍͛́̃̅̑͊̀̀̎̃̊̾̀̚͜͠ͅȩ̸̡̢̧̡̧̼̖̞̮͍͓͙̪͓͉͖̮̙̙̟̳͙͍͍̲̱̬̰̜̥̙̻̫̜̗̯̼̖͚͕̜̝̳͈̮͍̱͖̰̬̟̱̊͊̋͐̉͒̿̊͛̏̌̏̌̒͋̈́̄̎͐́̐̀̉̈͒̀͊̈́̀̓̿̓̏̓̆̌̚͘̕̚͘͜ͅͅ ̷̨̙̙̯̈́͋̍̃̆̋̽͛͒̓̇̈́̔̒̋̇̒̃̓͑̚̚͝͠w̸̛̛̛̦̮̦̮̥̮̣͎̳̤̹͑̋̃̂͆̎̂̄̅̈̍̍̊̅̈̍̈́̂̄̐͆͂́̀̃̎̆͘̚̚͝͠͠͝͠͠ą̶̢̢̢͚͇̥͔̫͕̹̻̳̜̬̲̘̝̜̣̻̼͈͈̺̫̻͉̭̺͇̝͚͚͈̳̦̻̩̙̞̦͂̒̉͌͐͂̎̈͒̀͌T̶̢̧̛͔͎̼̻̳̹̞̬͚̘͕̣͎̬̠͍̣̲͎͙̖̗͕̬̼̝̲̭̠͕̗͙̰̬͚̞͎̓͆̓͊̀̑͐̾̃̒̏̇́̈͛̍̅̄̈́̍̇̈́͑̒͛́̾̑̾͘͘͘̕͘͜͝͝͝ͅç̴̡̨̛̛̮̳̲̰̮̻͔͎̙̓̈̾̽͂́̎́̀͆̅̑͑̇̎͌͋͗̅̔̅̀̈́̔̽̐͂̕̕̚͠ḥ̵̨͈̿͛̉̽̀̑̾̽̉͜Í̸̘͖͕̝͙͖̦̰͔̄͛͒̎͌̾̒̅n̵̛͍͇̆̄̐́̾̒̐́̈́̒̓̂͆̉̈́͋̇̒̌̆̀̈́̈́́̆͊̆̅̈̈́͆̊͊̓̑̄̾̈́̌̈́̇͌̌̊͆̌͋̈́͑̀̃̈́͘̚͘̚̚͠ģ̷̢̡̧̖͓̰͙̗̬̫̮̤̣̗͈̼̞̲̝̘̻͈͍̦̻͖͓̼̮͕͎̮͔͖͔̘̬̖̥̠̀̔́̓̎̓̄͒̈́͋̎̀̎͐͌͂̒̾͗͒̈́̂̆͋̍̍́͌̈́͒̄̀͊̾̉͐̂̿̀̀͆̈́͗͋̌̋̈́̕͝͠͝͝ͅ ̵̨̨̢̧̨̛̛̛͖̺̜̝͖̦͙̞̱̭̻̤̟̫̻̰̩̩̼̻͕̼͎̭͇̬̝̰͔̝̞͇̥̲̙͕̘̮̲͕͎͎̣̥̻̪̻̭͑̾̓̎̾̒̏̂̈͐͋̑͘͜͜ͅy̸̢̢̡͚̜̳̦̖͓̠̞͇̣͈͇̞̺̦̣̘̬̲͚͚̙̥̻̗͖͍̗̝̮̤̩̮̦̜̲͈̝̫͙̞͋͌̊̍̆̒̆̍̋̎̄̌͐̔͊̎͒͌̐́͗̂̐̾͒̐͆̀̕͜͜ͅO̸̧̧̨̡̨̧̨̧̡̯͈̘̟͇̥͍̰̭̜͕̩̘̺͖͙̖̝͍͍͍̯̝̮̟̗̬͚̟͕̖̞̯͉̼̟̬̙̝͉͚̻͔̲̣̖͙̓͑͂̈͌͒̓͌̏̌̆͛̍̒̈̈́̍̊̓̈́̓̆͒̈́͗̇̽̚͘͜͜ͅͅu̶̡̡̢̯̼̞͕̭̝͇̺͓͓͉͚͍̙͔͎̟̥͈̯̞͈̥̥̝̹̪̠͖̣͚̜̮̤̞̲̤͆͛̏̒͗͑̃̆̑̂̐̈́́̒̿̾͌̽̀̈́̂̊̎̈̏̆̀̐̓̎̿̈́̊̃͊͗̈́̅̌͑̋̔͘͘̚͘̚̕͜͜͜͠͝ͅͅ")
